export const getAllNavigate = async () => {
  try {
    const response = await fetch("http://localhost:3000");
    const body = await response.json();
    return body;
  } catch (error) {
    console.error(error);
    return null;
  }
};

export const getAllProducts = () => {
  return fetch("/trasport-products")
    .then((res) => res.json())
    .then((body) => body.products);
};
